import React from 'react';

import EventList from '../components/EventList';
import BigEvent from './bigEvent.jpg';

// Events is called in App.js where the route been defined
const Events = () => {
	// dummy events
	const EVENTS = [
		{
			id: 'u1',
			name: 'Solo 1',
			image:
				'https://media.gettyimages.com/photos/san-jose-twilight-picture-id1058214402?s=2048x2048',
			detail: '06/25/2020',
		},
		{
			id: 'u2',
			name: 'Solo 2',
			image: BigEvent,
			detail: '06/25/2020',
		},
		{
			id: 'u3',
			name: 'Solo 3',
			image: './event.jpg',
			detail: '06/25/2020',
		},
	];

	// calling EventList from EventList.js where it passes EVENTS to child EventList
	// just treat the following call as EventList(items = EVENTS); items is the props
	// name defined in EventList
	return <EventList items={EVENTS} />;
};

export default Events;
